class Constraint_graph:
    def __init__(self, csp):
        self.graph = nx.Graph()
        self.csp = csp
        self.load_csp_to_graph()

    def add_edge(self, node1, node2):
        self.graph.add_edge(node1, node2)

    def add_node(self, node):
        self.graph.add_node(node)

    def get_nodes(self):
        return self.graph.nodes

    def get_edges(self):
        return self.graph.edges

    def get_neighbors(self, node):
        return self.graph.neighbors(node)

    def remove_nodes(self, nodes):
        self.graph.remove_nodes_from(nodes)

    def load_csp_to_graph(self):
        for variable in self.csp.variables:
            self.add_node(variable)

        for constraint in self.csp.constraints:
            node1 = constraint[0]
            node2 = constraint[1]
            self.add_edge(node1, node2)

    def draw(self, color):
        if not color:
            nx.draw(self.graph, node_size = 2000, with_labels = True)
        else:
            nx.draw(self.graph, node_size = 2000, node_color = [color[n] for n in self.get_nodes()], with_labels=True)

    def has_cycle(self):

        def dfs(G, node, visited, parent):
            visited.add(node)
            for neighbor in G.neighbors(node):
                if neighbor not in visited :
                    if dfs(G, neighbor, visited, node):
                        return  True
                elif (neighbor != parent):
                    return True
            return False

        visited = set()
        for node in self.graph:
            if node not in visited:
                if dfs(self.graph, node, visited, 0):
                    return True
        return False

    def all_subsets(self, lst):
        if len(lst) == 0:
            return [[]]
        subsets = []
        first_elem = lst[0]
        rest_elems = lst[1:]
        for subset in self.all_subsets(rest_elems):
            subsets.append(subset)
            new_subset = subset + [first_elem]
            subsets.append(new_subset)
        return subsets       

    def find_smallest_cycle_cutset(self):
        res = []
        my_min = len(self.graph)
        my_subsets = self.all_subsets(list(self.graph.nodes))
        for one_subset in my_subsets:
            lst_node_remind = list(self.graph.nodes())
            G_tm = copy.deepcopy(self)
            G_tm.remove_nodes(one_subset)
            for x in one_subset:
                lst_node_remind.remove(x)
            if len(G_tm.get_nodes())==0:
                continue
            if G_tm.has_cycle() == False and my_min >= len(one_subset):
                res = one_subset
                my_min = len(one_subset)
        return res

    def remove_smallest_cycle_cutset(self):
        res = copy.deepcopy(self)
        res.remove_nodes(self.find_smallest_cycle_cutset())
        return res

