def make_arc_consistent(x1, x2, D, C):
    if not x1:
        return True

    d1 = D.get(x1)
    for val_x1 in d1.copy():
        if not any(is_consistent(x1, val_x1, x2, val_x2, C) for val_x2 in D.get(x2)):
            d1.remove(val_x1)

    D.update({x1: d1})
    if not d1:
        return False
    return True

