def find_parent(X, G, node):
    i = X.index(node)
    edges = G.get_edges()
    for j in range(i - 1, -1, -1):
        if (X[j], node) in edges or (node, X[j]) in edges:
            return X[j]
    return None

%pyspark

def choose_consistent_value(node, assignment, D, X, G):
    domain = D.get(node)
    parent = find_parent(X, G, node)
    if parent is None:
        return random.choice(domain)
    for val in domain:
        if assignment[parent] != val:
            return val

