def tree_csp_solver(csp):
    D = csp.domains
    C = csp.constraints
    assignment = {}
    root = random.choice(csp.variables)
    graph = Constraint_graph(csp)
    X = topological_sort(graph, root)
    n = len(X)

    for j in range(n - 1, 0, -1):
        parent = find_parent(X, graph, X[j])
        if not make_arc_consistent(parent, X[j], D, C):
            return None

    for i in range(n):
        assignment[X[i]] = choose_consistent_value(X[i], assignment, D, X, graph)
        if not assignment[X[i]]:
            return None

    return assignment

