def solve_cutset(cutset, csp):
    cutset_problem = constraint.Problem()

    for var in cutset:
        cutset_problem.addVariable(var, csp.domains.get(var))

    for c in csp.constraints:
        if c[0] in cutset and c[1] in cutset:
            cutset_problem.addConstraint(lambda x, y: x != y, c)

    return cutset_problem.getSolutions()
